 _bt_scale_range(\n        ohlc_range,\n        source.data['ohlc_high'].slice(i, j),\n        source.data['ohlc_low'].slice(i, j));\n    try {\n        _bt_scale_range(\n            volume_range,\n            source.data['Volume'].slice(i, j),\n            0);\n    } catch (e) {}  // volume_range may be undefined\n\n}, 50);\n"},"id":"2903","type":"CustomJS"},{"attributes":{},"id":"2421","type":"BasicTicker"},{"attributes":{"below":[{"id":"2601"}],"center":[{"id":"2604"},{"id":"2608"}],"left":[{"id":"2605"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","plot_height":90,"plot_width":null,"renderers":[{"id":"2631"}],"sizing_mode":"stretch_width","title":{"id":"2955"},"toolbar":{"id":"2618"},"toolbar_location":null,"x_range":{"id":"2365"},"x_scale":{"id":"2597"},"y_range":{"id":"2595"},"y_scale":{"id":"2599"}},"id":"2593","subtype":"Figure","type":"Plot"},{"attributes":{"data":{},"selected":{"id":"2515"},"selection_policy":{"id":"2514"}},"id":"2496","type":"ColumnDataSource"},{"attributes":{"source":{"id":"2401"}},"id":"2581","type":"CDSView"},{"attributes":{"fill_color":{"value":"red"},"line_color":{"value":"red"},"size":{"units":"screen","value":8},"x":{"value":1103},"y":{"value":0.5411664773268018}},"id":"2497","type":"Scatter"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"returns_pos","transform":{"id":"2403"}},"line_alpha":{"value":0.1},"marker":{"value":"triangle"},"size":{"units":"screen","value":13},"x":{"field":"index"},"y":{"field":"returns_long"}},"id":"2579","type":"Scatter"},{"attributes":{"data_source":{"id":"2401"},"glyph":{"id":"2578"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"2579"},"selection_glyph":null,"view":{"id":"2581"}},"id":"2580","type":"GlyphRenderer"},{"attributes":{},"id":"2680","type":"DataRange1d"},{"attributes":{"data":{"100MA":{"__ndarray__":"AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4
